/**
* QQ小窝自动钓鱼
*
*/

// 按钮的图片base64
const btnTemplateBase64 = "data:image/png;base64,"


// 游戏界面的activity
const targetActivity = "com.tencent.mobileqq.zootopia.ZootopiaUEActivity"

// 显示控制台
console.show();
console.setTitle("钓鱼助手")
console.setPosition(50, 50)

// 等待打开无障碍服务
auto.waitFor();


console.info("请打开QQ小窝并开始钓鱼【请保持竖屏模式】")

// 等待打开qq小窝,每1000ms扫描一次
waitForActivity(targetActivity, 100)

// 打开后开始执行自动点击
autoClick()

function autoClick() {

    console.info("已打开小窝,开始监测屏幕【请保持竖屏模式】")

    // 记录鱼的数量
    let fishTotal = 0

    // 申请截图
    if (!requestScreenCapture()) {
        toast("请求截图失败");
        exit();
    }

    // 将base64转化为img对象
    let templateImg = images.fromBase64(btnTemplateBase64)

    while (true) {
        sleep(200)
        try {
            // 执行截图
            var img = images.captureScreen();

            // 找从图片中找模板图片
            var point = images.findImage(img, templateImg, { threshold: 0.8 })

            if (point) {
                click(point.x, point.y)
                sleep(5000)
                click(point.x, point.y)
                sleep(1000)
                click(point.x, point.y)
                console.clear()
                fishTotal++
                console.info(`本次已经自动钓到${fishTotal}条鱼`)
            }
        } catch (e) {
            let errorMessage = e.message
            if ("java.lang.IllegalStateException: Image is already closed" === errorMessage) {
                // 旋转屏幕导致异常
                toastLog("屏幕方向发生改变可能会导致监测位置错误,如果停止了钓鱼,请重新手动开始抛竿")
            } else {
                console.error(errorMessage)
                break
            }
        }
    }

}